import styled from "styled-components";

export const BoundingBoxContainer = styled.div`
  position: absolute;
  box-shadow: 0 0 0 3px #149df2 inset;
  display: flex;
  flex-wrap: wrap;
  justify-content: center;
  cursor: pointer;
  top: ${(props) => props.leftCol};
`;
